	shuffle(d);

	setTimeout(function() {
		location.href = "https://m.youtube.com/watch?v=" + d[0];
	}, 100);

}

function shuffle(arr) {
	for (var i = arr.length - 1; i > 0; i--) {
		var j = Math.floor(Math.random() * (i + 1));
		var temp = arr[i];
		arr[i] = arr[j];
		arr[j] = temp;
	}
}
